import React, { useContext, useState } from 'react';
import Avatar from '@mui/material/Avatar';
import { Box, Button, Container, Link, TextField, FormControlLabel, Checkbox, Grid, Typography, Alert } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import axios from 'axios';
import { UserContext } from '../Context';
import { useNavigate } from 'react-router-dom';



function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

export default function SignUp() {
  const { login } = useContext(UserContext);
  const [user, setUser] = useState({
    username: "",
    email: "",
    password: ""
  })

  const [message, setMessage] = useState("")
  const [error, setError] = useState("");

  const handleUsernameChange = (e) => {
    const value = e.target.value;
    setUser({ ...user, username: value });

    if (value.length < 3) {
      setError("שם משתמש חייב להכיל לפחות 3 תווים");
    } else if (value.length > 20) {
      setError("שם משתמש לא יכול להכיל יותר מ-20 תווים");
    } else {
      setError(""); // אין שגיאה
    }
  };




  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post('http://localhost:3000/users/signup', user);
      if (response.status === 200) {
        login(response.data);
        setMessage("משתמש נוסף בהצלחה")
      }
      console.log(response);  // תדפיס את התגובה שהתקבלה מהשרת
    } catch (error) {
      console.log("Error:", error);  // תדפיס את השגיאה המלאה
    }
  };



  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Avatar
          sx={{
            margin: 1,
            backgroundColor: 'secondary.main',
          }}
        >
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          הרשמה
        </Typography>
        <Box
          component="form"
          noValidate
          sx={{
            width: '100%',
            marginTop: 3,
          }}
          onSubmit={handleSubmit}
        >
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <TextField
                autoComplete="fname"
                name="firstName"
                variant="outlined"
                required
                fullWidth
                id="firstName"
                label="שם משתמש"
                error={!!error}
                helperText={error}
                onChange={handleUsernameChange}
              />;
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="email"
                label="כתובת מייל"
                name="email"
                autoComplete="email"
                onChange={(e) => setUser({ ...user, email: e.target.value })}

              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="password"
                label="סיסמא"
                type="password"
                id="password"
                autoComplete="current-password"
                onChange={(e) => setUser({ ...user, password: e.target.value })}
              />
            </Grid>
            <Grid item xs={12}>
              <FormControlLabel
                control={<Checkbox value="allowExtraEmails" color="primary" />}
                label="אני רוצה לקבל השראה, מבצעים שיווקיים ועדכונים במייל."
              />
            </Grid>
          </Grid>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            sx={{
              marginTop: 3,
              marginBottom: 2,
            }}
          >
            הרשמה
          </Button>
          <Grid container justifyContent="flex-end">
            <Grid item>
              <Link href="/login" variant="body2">
                יש לך כבר חשבון? היכנס
              </Link>
            </Grid>
          </Grid>
        </Box>
      </Box>
      {message != "" && <Alert severity="success">{message}</Alert>}

    </Container>
  );
}
